description:
Verenigde Staten
Komedie / Romantiek
90 minuten

geregisseerd door Tom Putnam
met Paris Hilton, Joel Moore en Christine Lakin

Nate Cooper verhuist naar Los Angeles omdat hij nog steeds op zoek is naar Cristabelle Abbott, het meisje waar hij vroeger al van droomde. Zijn pogingen om met Cristabelle in contact te komen worden echter telkens verstoord door haar niet zo knappe vriendin June Phigg. Het wordt allemaal nog veel gecompliceerder wanneer Nate juist gevoelens krijgt voor June.


